// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Imports from State
import Login from './components/State/Login';
import Home from './components/State/Home';
import Register from './components/State/Register';
import Dashboard from './components/State/Dashboard';
import StaffLogin from './components/State/StaffLogin';
import StaffDashboard from './components/State/StaffDashboard';
import AdminDashboard from './components/State/AdminDashboard'; 
import AdminManageStaff from './components/State/AdminManageStaff'; 
import AdminAppliCap from './components/State/AdminAppliCap';
import AdminViewApplicants from './components/State/AdminViewApplicants';
import AdminManageAnnouncements from './components/State/AdminManageAnnouncements';
import Profile from './components/State/Profile';
import AppApply from './components/State/AppApply';
import ViewApp from './components/State/ViewApp';
import MonitorCheckedApp from './components/State/MonitorCheckedApp';
import AdmincheckApps from './components/State/Adminviewapp';
import CheckStatus from './components/State/CheckStatus';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/" element={<Home />} />
        <Route path="/staff-login" element={<StaffLogin />} />
        <Route path="/staff-dashboard" element={<StaffDashboard />} />
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/admin-manage-staff" element={<AdminManageStaff />} />
        <Route path="/admin-manage-applications" element={<AdminAppliCap />} />
        <Route path="/admin-view-applicants" element={<AdminViewApplicants />} />
        <Route path="/admin-manage-announcement" element={<AdminManageAnnouncements />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/apply" element={<AppApply />} />
        <Route path="/viewapp" element={<ViewApp />} />
        <Route path="/admin-monitor-status" element={<MonitorCheckedApp />} />
        <Route path="/admin-view" element={<AdmincheckApps />} />
        <Route path="/check-status" element={<CheckStatus />} />
      </Routes>
    </Router>
  );
}

export default App;
